script: |
  super -f text -I q2913.spq | sort > q2913.out

inputs:
  - name: q2913.spq
    data: |
      SELECT DISTINCT - ( + - COUNT ( * ) ) + - + COUNT ( * ) + + 14 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab0 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q2913.out
    data: |
      14
